function TaskItem({ task}) {
    return (
    <li>
    <input
    type="checkbox"
    checked={task.completed}
    disabled
    />
    <span style={{ textDecoration: task.completed ? 'line-through' : 'none' }}>
    <img
        src={task.imageUrl} // Utilisez la propriété imageUrl au lieu de text
        alt={task.text}
        style={{ maxWidth: '100px', maxHeight: '100px' }} // Ajustez la taille selon vos besoins
      />
    </span>
    </li>
    );
    }
